import React  from 'react'
import logo from '../../assets/logoShuhai.png';
import './Footer.css';
import FooterMenu from "./FooterMenu";
import {Link} from "react-scroll/modules";
import {NavLink} from "react-router-dom";

function Footer(props) {
    const footer1MenuTitle = 'Меню';
    const footer2MenuTitle = 'Контакти';
    const footer3MenuTitle = 'Соц. Мережі';
    const footerMenuContent = <React.Fragment style={{color:'white'}}>
        <Link to="about" smooth={true} className="header__navigation-link">Про мене</Link>
        <Link to="group" smooth={true} className="header__navigation-link">Про групи</Link>
        <Link to="contacts" smooth={true} className="header__navigation-link">Контакти</Link>
    </React.Fragment>;
        return (
            <footer className="footer">
                <FooterMenu  content={footerMenuContent} title={footer1MenuTitle}/>
                <FooterMenu title={footer2MenuTitle}/>
                <FooterMenu title={footer3MenuTitle}/>
            </footer>
        )
}
export default Footer;
